// implement infinit loading
import BookCard from '../components/BookCard.js'
import { useState } from 'react'

const SearchContent = () => {
  const [bookList] = useState([
    {
      imgCover: 'http://books.google.com/books/content?id=-bF2CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api',
      title: 'harry potter',
      author: 'lindsay lohan'
    },
    {
      imgCover: 'http://books.google.com/books/content?id=-bF2CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api',
      title: 'harry potter',
      author: 'lindsay lohan'
    },
    {
      imgCover: 'http://books.google.com/books/content?id=-bF2CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api',
      title: 'harry potter',
      author: 'lindsay lohan'
    },
    {
      imgCover: 'http://books.google.com/books/content?id=-bF2CwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api',
      title: 'harry potter',
      author: 'lindsay lohan'
    }
  ])
  return (
    <div>
      {
        bookList.length === 0 ?
          <div className="content text-center mt-3">
            <span className="void-search">No results for this search</span>
          </div>
        :
          <div className="search-content content">
            {
              bookList.map((book) => <BookCard book={ book } />)
            }
            <br />
          </div>
      }
    </div>
  )
}

export default SearchContent
